Surrounding the intrepid circumnavigators were not architectures built of timber or glass—abode shapes weaving urban tapestries. Steel had slit its fabled kiss with abandon, leaving rich jumbles of form-bone sinew, subtly resembling honeyed stone warmed by intangible suns. These opulent edifices nodded perversely to the soft songs inhabiting marrow; this spectrum was unheard but mournful upon the warmth of wool.

